import React from 'react';
import TableCell from '@material-ui/core/TableCell';
import TableRow from '@material-ui/core/TableRow';

type ProductItemProps = {
    key: number,
    product: any
}

const ProductItem: React.FC<ProductItemProps> = (props) => {
    return (
        <TableRow key={props.key}>
            <TableCell>{props.product.id}</TableCell>
            <TableCell>{props.product.billing.firstName} {props.product.billing.lastName} </TableCell>
            <TableCell>{props.product.shipping_total}</TableCell>
            <TableCell>{props.product.status}</TableCell>
            <TableCell>{props.product.shipping_lines.method_title}</TableCell>

        </TableRow>
    );
}

export default ProductItem;
